  const getAllMovies = () => {
    axios.get("https://api.themoviedb.org/3/movie/popular?api_key=9896037be7d85d7cbca87d0f2b0774c3&language=ar")
  }

  return (
    <div className="fs-2">
      <NavBar/>
      <Container>
        <MoviesList/>
      </Container>
    </div>
  );
}

export default App;
